import { Component, OnInit, ViewChild } from '@angular/core';
import { User } from '../userInterface';
import { FormBuilder, FormControl, FormGroup, Validators } from '@angular/forms';
import { Validator } from '@angular/forms';
import { ServiceService } from '../service.service';
import { find } from 'rxjs';



@Component({
  selector: 'app-form',
  templateUrl: './form.component.html',
  styleUrls: ['./form.component.css']
})
export class FormComponent implements OnInit {


  newGroup!: FormGroup;
  hasError = false;



    constructor(private fb: FormBuilder,private newarr:ServiceService) {

    }
    ngOnInit() {
      this.newGroup = this.fb.group({
        name: ['', Validators.required],
        phone: [' ', [Validators.required, Validators.pattern('^[0-9]*$')]],
        email: ['', [Validators.required, Validators.email]],
      });
    }
    addUser() {
      if(this.newGroup.invalid){
        alert("not valid")
  } else
      this.newarr.users.push(this.newGroup.value);

    }



}
<h2>Users Form</h2>

<form [formGroup]="newGroup" (ngSubmit)="addUser()">

  <br><br>

  <label>
    Name:
    <br>
    <input formControlName="name">
  </label>
  <div *ngIf="newGroup.get('name')?.invalid && (newGroup.get('name')?.dirty || newGroup.get('name')?.touched)">
    <div *ngIf="newGroup.get('name')?.hasError('required')">Name is required.</div>
  </div>
  <br><br>

  <label>
    Phone:
    <br>
    <input formControlName="phone">
  </label>
  <div *ngIf="newGroup.get('phone')?.invalid && (newGroup.get('phone')?.dirty || newGroup.get('phone')?.touched)">
    <div *ngIf="newGroup.get('phone')?.hasError('required')">Phone is required.</div>
    <div *ngIf="newGroup.get('phone')?.hasError('pattern')">Invalid phone format.</div>
  </div>
  <br><br>

  <label>
    Email:
    <br>
    <input formControlName="email">
  </label>
  <div *ngIf="newGroup.get('email')?.invalid && (newGroup.get('email')?.dirty || newGroup.get('email')?.touched)">
    <div *ngIf="newGroup.get('email')?.hasError('required')">Email is required.</div>
    <div *ngIf="newGroup.get('email')?.hasError('email')">Invalid email format.</div>
  </div>
  <br><br>

  <button type="submit" [disabled]="!newGroup.valid">Submit</button>

</form>

<app-shows></app-shows>
